import React, {useState} from 'react';
import Card from '../MainCard/Card';
import Component1 from '../Item/Component1';
import './LargeComponent.css'
import FilterYear from '../YearFilterComponent/YearFilter';

function LargeComponent(props){
    const [a,b] = useState('');

    const option1Handler =(props)=>{
        const option1 = [
            {id : 'e4' ,
            date : new Date (2019,11,14) ,
            title : 'Fan' ,
            price : 70}
        ];
        props.Handler1(option1);
    }
    const option2Handler =(props)=>{
        const option2 = [
            {id : 'e3' ,
            date : new Date (2020,6,8) ,
            title : 'Fridge' ,
            price : 500 }
        ];
        props.Handler2(option2);
    }
    const option3Handler =(props)=>{
        const option3 = [
            {id : 'e2' ,
            date : new Date (2021,4,15) ,
            title : 'Hand Blender' ,
            price : 45}
        ];
        props.Handler3(option3);
    }
    const option4Handler =(props)=>{
        const option4 = [
            {id : 'e1' ,
            date : new Date (2022,2,26) ,
            title : 'Oven' ,
            price : 150},
    
            {id : 'e4' ,
            date : new Date (2022,9,7) ,
            title : 'Microwave' ,
            price : 200}
        ];
        props.Handler4(option4);
    }
    return(
        <Card className="LargeComponent">
            <Component1 onOption1={option1Handler}/>
            <Component1 onOption1={option2Handler}/>
            <Component1 onOption1={option3Handler}/>
            <Component1 onOption1={option4Handler}/>
            <Component1 onOption1={option4Handler}/>
        </Card>
    );
}

export default LargeComponent;
